import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const ResultsTable = ({ results }) => {
  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>LinkedIn Profil</TableCell>
            <TableCell>Vorhersage</TableCell>
            <TableCell>Empfehlungen</TableCell>
            <TableCell>Fehler</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {results.map((result, index) => (
            <TableRow key={index}>
              <TableCell>{`${result.firstName} ${result.lastName}`}</TableCell>
              <TableCell>
                <a href={result.linkedinProfile} target="_blank" rel="noopener noreferrer">
                  Profil ansehen
                </a>
              </TableCell>
              <TableCell>{result.confidence ? `${(result.confidence * 100).toFixed(2)}%` : '-'}</TableCell>
              <TableCell>{result.recommendations ? result.recommendations.join(', ') : '-'}</TableCell>
              <TableCell>{result.error || '-'}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ResultsTable;
